import React, { Fragment, useEffect, useState } from "react";
import "./Components.css";
import { DataGrid } from "@material-ui/data-grid";

const rows = [
  { id: 1, col1: "TATA65", col2: "Diskret Matematik" },
  { id: 2, col1: "TATA42", col2: "Envariabelanalys 2" },
  { id: 3, col1: "TATA1337", col2: "Envariabelanalys 5" },
];

const columns = [
  { field: "col1", headerName: "Kurskod", width: 150 },
  { field: "col2", headerName: "Kurs", width: 150 },
];

const CourseTable = () => {
  return (
    <div style={{ height: "300", width: "100%" }}>
      <DataGrid rows={rows} columns={columns} />
    </div>
  );
};

export default CourseTable;
